import base64
import io
from PIL import Image

iconB64 = (b'/9j/4AAQSkZJRgABAQACWAJYAAD'
           b'/2wBDAAgGBgcGBQgHBwcJCQgKDBQNDAsLDBkSEw8UHRofHh0aHBwgJC4nICIsIxwcKDcpLDAxNDQ0Hyc5PTgyPC4zNDL'
           b'/wgALCAPUA9QBAREA/8QAHAABAAMBAQEBAQAAAAAAAAAAAAYHCAUBBAMC/9oACAEBAAAAAL'
           b'')
def getIconImage():
    imgBytes = base64.b64decode(iconB64)
    return Image.open(io.BytesIO(imgBytes))